$templateCache.put("tmpl/how-we-stay-unbiased.html","<section class=\"section-account\">\n    <div class=\"spacer-5pc\"></div>\n    <div class=\"card contain-sm style-transparent\">\n        <div class=\"card-body\">\n            <div class=\"row\">\n                <div class=\"card about-section\">\n                    <h1 class=\"text-light\">How do we stay unbiased?</h1>\n\n                    <p>Now we hear you thinking. It’s very nice you guys rate Coins &amp; Tokens. BUT: WHO SAYS YOU DON’T RATE THEM IN THE FAVOUR OF THE COINCHECKUP TEAM.</p>\n\n                    <h2>Don’t be like them Credit Rating agencies!</h2>\n\n                    <p>We don’t think many investors have a very positive opinion on the credit rating agencies: <a href=\"https://standardandpoors.com/\" target=\"_blank\">Standard &amp; Poor</a> and <a href=\"https://www.moodys.com/\" target=\"_blank\">Moody\'s</a>. They got paid in order to give good credit rating by the very same companies they are rating in the first place. This is obviously likely to result in biased ratings. The one who pays more, gets a more solid rating.</p>\n\n                    <p>Back in June \'17 when we started working on CoinCheckup’s rating formula it was directly clear for us we never wanted to get paid for giving out better ratings. It’s simply a 100% NO-GO! We believe this would be the most unfair way of making a living, neither would it add any value to our visitors.</p>\n\n                    <h2>So how does a coin get their rating on CoinCheckup?</h2>\n\n                    <p>How can we make sure we stay unbiased? It’s simple. We apply a fully transparent formula on every coin/token.</p>\n\n                    <p>Not all coins/tokens are the same, so the formula is different for a centralized, semi-decentralized, or decentralized coin. That being said, the formula is always the same for each type of coin and our ratings are always transparent.</p>\n\n                    <p>IF you go to a detail page, and go to “Analysis”, you’ll find the “Scores” tab. If you click “SEE FULL DETAILS”, you’ll see exactly how a Coin gets to the total score.</p>\n\n                    <p>When analysing the scores please take into account:</p>\n                    <ul>\n                        <li>We’re aiming at making the crypto-space more transparent, this is why we’ve shared our formula publicly</li>\n                        <li>We score based on info listed on official sources of each coin (website, whitepaper, blog, FAQs, bitcointalk thread, etc)</li>\n                        <li>If a coin is not transparent about the information and does not make it available publicly, this will affect their rating as it cannot get scored.</li>\n                        <li>We use statistical <a href=\"https://en.wikipedia.org/wiki/Percentile\" target=\"_blank\">percentiles</a> for most of the dimensions where this applies, so we eliminate the bias of setting fixed ranges. This way we can compare coins with each other and allow the industry to raise the bar by itself</li>\n                        <li>We offer all of our users the possibility to request changes to coin information as long as it can be publicly verified</li>\n                        <li>We believe coins should be transparent in communication with their users, thus we score this aspect</li>\n                        <li>We believe coins should keep their followers updated with progress on their projects, so we track this as well (automated)</li>\n                        <li>We believe that for centralized/semi-centralized coins, the team &amp; advisors behind a coin play a significant role in completing the milestones, thus we look at them both in terms of structure and previous experience</li>\n                        <li>We look at Github activity to track that development activity is sustained throughout the lifetime of a project (automated)</li>\n                        <li>We look at both product itself but also at the coin strength compared to how all others perform in the market (automated)</li>\n                    </ul>\n\n                    <h2>The Rating Formula</h2>\n\n                    <p>In order to give you more transparency you’ll find the full Coin scoring formula below.</p>\n\n                    <p>We want CoinCheckup to be a platform of the community. A platform where we, as a community, can find those Unique Coins that didn’t grow yet, and a Platform where we, as a community, can find Scams. Support us, and we keep supporting you.</p>\n\n                    <p>You’ll find our current formulas in <a href=\"https://docs.google.com/document/d/1jnmTA1B_eQsBNaO_JkvlX-5f5TwcOUDR58HLGNfoPjQ/edit#heading=h.vtzcqvbw7wnb\" target=\"_blank\">this Google Doc</a> (as well as the deprecated old formula). We left the Comment function open for you. So you and the rest of the CoinCheckup community can share your feedback.</p>\n                </div>\n            </div><!--end .row -->\n        </div><!--end .card-body -->\n    </div><!--end .card -->\n</section>\n");
